import { useState } from "react";

import ChatBox from "../ChatBox/ChatBox";

const Support = ()=>{

   const [open,setOpen]=useState(false);

   const Open=()=>{
      setOpen(!open);
   }

   return <>
      <button onClick={()=>Open()}>Open</button>
       <ChatBox 
         open={open}
         SetOpen={Open}
        />
   </>;
}

export default Support;
